result:
.nowrap {
  white-space: nowrap;
}

.reloadBalance {
    right: 10px;
    background: #fa2843;
    width: 40px;
    height: 25px;
    text-align: center;
    color: #fff;
    border-radius: 5px
}

.menuMobileTopMobile{
  display: none;
}

.tabMenuMobileTOP{
    visibility: hidden;
    position: fixed;
    height: 60px;
    left: 0;
    right: 0;
    top: -60px;
    background: #02142b;
    z-index: 999;
    transform: translate3d(0, 0, 0);
    transition-property: -webkit-transform visibility;
    transition-property: transform visibility;
    transition-property: transform visibility, -webkit-transform visibility;
    transition-duration: .2s;
}


.notification-dropdown-button-number {
    position: absolute;
    top: -7px;
    left: calc(50% + 2px);
    display: inline-block;
    overflow: hidden;
    background: #e22a67;
    color: #fff;
    min-width: 18px;
    height: 18px;
    line-height: 14px;
    border-radius: 50%;
    font-weight: bold;
    font-size: 9px;
    border: 2px solid #02142b;
    padding: 0 2px;
}

.toggleButtonWrapper span {
    display: inline-block;
    line-height: 25px;
    padding-left: 5px;
    padding-right: 5px;
}

.setting .wrap .line .type svg, 
.setting .wrap .line .control svg {
    margin-right: 5px;
}

.setting .wrap .line-language-pc {
  padding: 15px;
  border-bottom: 1px solid #4A3C6F;
}

.setting .wrap .line {
  padding: 15px;
}

.qDeposit .allIn{
    position: absolute;
    right: 10px;
    top: 5px;
    font-size: 12px;
    height: 30px;
    line-height: 30px;
    color: #00ffe9;
}

.qDeposit .listWallShow {
    position: absolute;
    z-index: 1000;
    display: none;
    background-color: #38495d;
    background-clip: padding-box;
    border: 1px solid rgba(0,0,0,.15);
    border-radius: .25rem;
}

.qDeposit .listWallShow .drop{
    padding-top: 10px;
    padding-bottom: 10px;
    padding-left: 15px;
    padding-right: 15px;
}

.icon.USDT {
    background: url(data:image/svg+xml;base64,);
    background-repeat: no-repeat;
    background-position: center;
}

.icon.ETH {
    background: url('~@/assets/images/sky/eth.svg');
    background-repeat: no-repeat;
    background-position: 50%;
}

.icon.BTC {
    background: url('~@/assets/images/sky/bitcoin.svg');
    background-repeat: no-repeat;
    background-position: 50%;
}

.mhelper {
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
}

.mhelper span {
  text-align: center;
  white-space: nowrap;
}

@media screen and (max-width: 600px) {
  .msetting, .mhoso, .ttM, .mhelper {
    display: none !important;
  }

  .mTT svg{
    width: 1.7rem !important;
    height: 1.7rem !important;
  }

  .mTT .notification-dropdown-button-number{
    top: -10px;
    min-width: 22px;
    height: 22px;
    line-height: 18px;
    font-size: 12px;
  }

  .menuMobileTopMobile{
      position: fixed;
      right: 0;
      top: 60px;
      background: #02142b;
      padding: 0px 10px;
      border-bottom-left-radius: 20px;
      display: block;
      cursor: pointer;
  }

  .tabMenuMobileTOP.open{
      visibility: visible;
      transform: translate3d(0, 100%, 0);
  }
 
}

@media screen and (max-width: 425px) {
    .text-acc{
      zoom: .9;
    }
}


@media screen and (max-width: 376px) {
  .text-acc{
      zoom: .8;
    }
  .text-down{
    width: 1.2rem !important;
    height: 1.2rem !important;
  }
  .vs-tabs--li button.vs-tabs--btn{
    font-size: 12px;
  }
}


.content .inputGroup .input-append button {
    width: 60px;
    height: 38px;
    background: transparent;
    border: none;
}

.content .inputGroup .input-append {
    position: absolute;
    top: 0;
    right: 0;
    border-top-right-radius: 4px;
    border-bottom-right-radius: 4px;
    overflow: hidden;
}

.content {
    padding: 2rem;
}


.header {
    position: relative;
    background-color: #181c21;
}

.header .leftHeader {
    border-right: 1px solid rgba(255, 255, 255, 0.17);
}

.header .leftHeader, 
.header .rightHeader {
    padding: 2rem;
    flex: 1 auto;
    max-width: 50%;
}

.header .iconTransfer {
    width: 40px;
    height: 40px;
}

.header .changeAmount {
    position: absolute;
    top: 50%;
    left: 50%;
    -webkit-transform: translate(-50%, -50%);
    -ms-transform: translate(-50%, -50%);
    -moz-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
}
